import React from "react";
import Axios from "axios";
import { useState } from "react";
export default function UserRegister() {
    const [id, setId] = useState("");
    const [roleId, setRoleId] = useState("");
    const [firstName, setFirstName] = useState("");
    const [middleName, setMiddleName] = useState("");
    const [lastName, setLastName] = useState("");
    const [mobile, setMobile] = useState("");
    const [email, setEmail] = useState("");
    const [Password, setPassword] = useState("");
    const [registeredAt, setRegisteredAt] = useState("");
    const [lastLogin, setLastLogin] = useState("");
    const [intro, setIntro] = useState("");
    const [profile, setProfile] = useState("");

    const registerUser = (e) => {
        e.preventDefault();
        console.log("function called")
        Axios.post("http://localhost:3000/api/users/RegisterUser", {

                "id" : id,
                "roleId" : roleId,
                "firstName": firstName,
                "middleName": middleName,
                "lastName": lastName,
                "mobile": mobile,
                "email": email,
                "Password": Password,
                "registeredAt": Date.now(),
                "lastLogin": Date.now(),
                "intro": intro,
                "profile": profile

        }).then((response) => {
            alert("User Added Successfully")
        });
    }
    return (
        <div className="bg-orange-300 min-h-screen">
            <div class="flex items-center justify-center flex-col">
                <div class="flex justify-center w-80 bg-orange-100 rounded-lg shadow dark:border mt-6 w-96 dark:bg-gray-800 dark:border-gray-700">
                    <div class="bg-orange-100 px-6 py-8 rounded shadow-md text-black w-full">
                        <form>
                            <h1 class="mb-8 text-3xl font-bold text-center">Add New User</h1>
                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="fullname"
                                value={firstName}
                                onChange={(e) => setFirstName(e.target.value)}
                                placeholder="First Name" />

                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="middlename"
                                value={middleName}
                                onChange={(e) => setMiddleName(e.target.value)}
                                placeholder="Middle Name" />

                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="lastname"
                                value={lastName}
                                onChange={(e) => setLastName(e.target.value)}
                                placeholder="Last Name" />

                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="mobile"
                                value={mobile}
                                onChange={(e) => setMobile(e.target.value)}
                                placeholder="Mobile" />

                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="email"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                placeholder="Email" />

                            <input
                                type="password"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="Password"
                                value={Password}
                                onChange={(e) => setPassword(e.target.value)}
                                placeholder="Password" />
                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="intro"
                                value={intro}
                                onChange={(e) => setIntro(e.target.value)}
                                placeholder="Intro" />
                            <input
                                type="text"
                                class="block border border-grey-light w-full p-3 rounded mb-4"
                                name="profile"
                                value={profile}
                                onChange={(e) => setProfile(e.target.value)}
                                placeholder="Profile" />

                            <button
                                onClick={(e) => registerUser(e)}
                                class="w-full text-white bg-primary-600 bg-green-700 focus:ring-4 focus:outline-none focus:ring-primary-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-primary-600 dark:hover:bg-primary-700 dark:focus:ring-primary-800">Add User</button>

                        </form>
                    </div>
                </div>
            </div>
        </div>
    );

}
